textOriginal:
Era esperar demais que houvesse uma retratação por parte do Fernão; Mesmo com a comprovação dos fatos, mesmo expostos a argumentos respaldados na verdade, ele continua reativo.
Essa semana do Arena foi do balacobaco mas dá um orgulho tão grande e confesso que fiquei até emocionada com o discurso do Marcio Gomes no final(e as palmas da Raquel Landim,rsrs);
Abraços a todos, que venham as eleições!
